rule.algorithm:
LOCAL
      assemblies_of_parts : SET OF assembly_component_relationship := [];
    END_LOCAL;

LOCAL
      ndea_set : SET OF effectivity_assignment := [];
    END_LOCAL;
    ndea_set := QUERY ( ea <* effectivity_assignment | ( NOT ( 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.DATED_EFFECTIVITY' 
        IN TYPEOF( ea.assigned_effectivity ) ) ) );

function.algorithm:
LOCAL
      acr : SET OF assembly_component_relationship := input\assembly_component.occurrence_contexts;
      pvd : SET OF product_view_definition := [];
    END_LOCAL;
    REPEAT i := 1 TO HIINDEX( acr ) BY 1;
      IF NOT ( ( 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.' + 'ASSEMBLY_GROUP_COMPONENT' ) IN TYPEOF( acr[i]\
          product_occurrence_definition_relationship.relating_view ) ) THEN
        pvd := pvd + acr[i]\product_occurrence_definition_relationship.relating_view;
      ELSE
        pvd := pvd + get_assemblies( acr[i]\product_occurrence_definition_relationship.relating_view );
      END_IF;
    END_REPEAT;
    RETURN( pvd );

LOCAL
      acr : SET OF assembly_component_relationship := [];
      pvd : SET OF product_view_definition := [];
    END_LOCAL;
    REPEAT i := 1 TO HIINDEX( input ) BY 1;
      acr := input[i]\assembly_component.occurrence_contexts;
    END_REPEAT;
    REPEAT i := 1 TO HIINDEX( acr ) BY 1;
      IF NOT ( ( 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.' + 'ASSEMBLY_GROUP_COMPONENT' ) IN TYPEOF( acr[i]\
          product_occurrence_definition_relationship.relating_view ) ) THEN
        pvd := pvd + acr[i]\product_occurrence_definition_relationship.relating_view;
      ELSE
        pvd := pvd + get_assemblies( acr[i]\product_occurrence_definition_relationship.relating_view );
      END_IF;
    END_REPEAT;
    RETURN( pvd );

LOCAL
      acr : SET OF assembly_component_relationship := input\assembly_component.occurrence_contexts;
      agc : SET OF assembly_group_component := [];
    END_LOCAL;
    REPEAT i := 1 TO HIINDEX( acr ) BY 1;
      IF ( 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.' + 'ASSEMBLY_GROUP_COMPONENT' ) IN TYPEOF( acr[i]\
          product_occurrence_definition_relationship.relating_view ) THEN
        agc := agc + acr[i]\product_occurrence_definition_relationship.relating_view;
      END_IF;
    END_REPEAT;
    RETURN( agc );

LOCAL
      p : SET OF product := [];
    END_LOCAL;
    REPEAT i := 1 TO HIINDEX( input ) BY 1;
      p := p + input[i]\product_version.of_product;
    END_REPEAT;
    RETURN( p );

LOCAL
      pv : SET OF product_version := [];
    END_LOCAL;
    REPEAT i := 1 TO HIINDEX( input ) BY 1;
      pv := pv + input[i]\product_view_definition.defined_version;
    END_REPEAT;
    RETURN( pv );

LOCAL
      result : BOOLEAN;
    END_LOCAL;
    IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.SIMPLE_GENERIC_EXPRESSION' IN TYPEOF( arg1 ) THEN
      RETURN( TRUE );
    END_IF;
    IF arg1 IN arg2 THEN
      RETURN( FALSE );
    END_IF;
    IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.UNARY_GENERIC_EXPRESSION' IN TYPEOF( arg1 ) THEN
      RETURN( acyclic( arg1\unary_generic_expression.operand, arg2 + [arg1] ) );
    END_IF;
    IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.BINARY_GENERIC_EXPRESSION' IN TYPEOF( arg1 ) THEN
      RETURN( acyclic( arg1\binary_generic_expression.operands[1], arg2 + [arg1] ) AND acyclic( arg1\binary_generic_expression.
          operands[2], arg2 + [arg1] ) );
    END_IF;
    IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.MULTIPLE_ARITY_GENERIC_EXPRESSION' IN TYPEOF( arg1 ) THEN
      result := TRUE;
      REPEAT i := 1 TO SIZEOF( arg1\multiple_arity_generic_expression.operands ) BY 1;
        result := result AND acyclic( arg1\multiple_arity_generic_expression.operands[i], arg2 + [arg1] );
      END_REPEAT;
      RETURN( result );
    END_IF;

LOCAL
      x : SET OF assembly_component_placement_link;
    END_LOCAL;
    IF relation.precedent_element IN relatives THEN
      RETURN( FALSE );
    END_IF;
    x := QUERY ( pd <* bag_to_set( USEDIN( relation.precedent_element, 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.' + 
        'ASSEMBLY_COMPONENT_PLACEMENT_LINK.'  + 'SUBSEQUENT_ELEMENT' ) ) | ( specific_relation IN TYPEOF( pd ) ) );
    REPEAT i := 1 TO HIINDEX( x ) BY 1;
      IF NOT acyclic_assembly_component_placement_link( x[i], relatives + relation.precedent_element, specific_relation ) THEN
        RETURN( FALSE );
      END_IF;
    END_REPEAT;
    RETURN( TRUE );

LOCAL
      x : SET OF linear_array_placement_group_component_link;
    END_LOCAL;
    IF relation.precedent_element IN relatives THEN
      RETURN( FALSE );
    END_IF;
    x := QUERY ( pd <* bag_to_set( USEDIN( relation.precedent_element, 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.' + 
        'LINEAR_ARRAY_PLACEMENT_GROUP_COMPONENT_LINK.'  + 'SUBSEQUENT_ELEMENT' ) ) | ( specific_relation IN TYPEOF( pd ) ) );
    REPEAT i := 1 TO HIINDEX( x ) BY 1;
      IF NOT acyclic_linear_array_placement_group_component_link( x[i], relatives + relation.precedent_element, specific_relation )
          THEN
        RETURN( FALSE );
      END_IF;
    END_REPEAT;
    RETURN( TRUE );

LOCAL
      x : SET OF representation_relationship;
    END_LOCAL;
    IF relation.rep_1 IN relatives THEN
      RETURN( FALSE );
    END_IF;
    x := QUERY ( r <* bag_to_set( USEDIN( relation.rep_1, 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.' + 
        'REPRESENTATION_RELATIONSHIP.'  + 'REP_2' ) ) | ( specific_relation IN TYPEOF( r ) ) );
    REPEAT i := 1 TO HIINDEX( x ) BY 1;
      IF NOT acyclic_representation_relationship( x[i], relatives + relation.rep_1, specific_relation ) THEN
        RETURN( FALSE );
      END_IF;
    END_REPEAT;
    RETURN( TRUE );

LOCAL
      the_set : SET OF GENERIC:intype := [];
      i       : INTEGER;
    END_LOCAL;
    IF SIZEOF( the_bag ) > 0 THEN
      REPEAT i := 1 TO HIINDEX( the_bag ) BY 1;
        the_set := the_set + the_bag[i];
      END_REPEAT;
    END_IF;
    RETURN( the_set );

IF b THEN
      RETURN( choice1 );
    ELSE
      RETURN( choice2 );
    END_IF;

LOCAL
      i  : INTEGER;
      td : length_measure := 0;
    END_LOCAL;
    REPEAT i := 1 TO swsrh.segments BY 1;
      td := td + swsrh.segment_depths[i];
    END_REPEAT;
    RETURN( td );

LOCAL
      ac : SET OF assembly_component := [];
    END_LOCAL;
    REPEAT i := 1 TO HIINDEX( input ) BY 1;
      ac := ac + input[i]\assembly_component_placement_link.precedent_element + input[i]\assembly_component_placement_link.
          subsequent_element;
    END_REPEAT;
    RETURN( SIZEOF( ac ) );

LOCAL
      ac : SET OF linear_array_placement_group_component := [];
    END_LOCAL;
    REPEAT i := 1 TO HIINDEX( input ) BY 1;
      ac := ac + input[i]\linear_array_placement_group_component_link.precedent_element + input[i]\
          linear_array_placement_group_component_link.subsequent_element;
    END_REPEAT;
    RETURN( SIZEOF( ac ) );

LOCAL
      result : SET OF kinematic_joint := [];
    END_LOCAL;
    REPEAT i := 1 TO HIINDEX( items ) BY 1;
      result := result + items[i].transformation_operator.joint;
    END_REPEAT;
    RETURN( result );

LOCAL
      return_set : SET [1 : ?] OF closed_shell := [brep.outer];
    END_LOCAL;
    IF SIZEOF( brep.voids ) >= 1 THEN
      return_set := return_set + brep.voids;
    END_IF;
    RETURN( return_set );

IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.CLASS_CONDITION_ASSOCIATION' IN TYPEOF( config.is_solution_for ) THEN
      IF config.configuration_type = configuration_kind.usage THEN
        RETURN( config.is_solution_for\class_condition_association.condition_type = 'part usage' );
      ELSE
        RETURN( config.is_solution_for\class_condition_association.condition_type = 'design case' );
      END_IF;
    END_IF;
    IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.CLASS_SPECIFICATION_ASSOCIATION' IN TYPEOF( config.is_solution_for )
        THEN
      IF config.configuration_type = configuration_kind.usage THEN
        RETURN( config.is_solution_for\class_specification_association.association_type = 'part usage' );
      ELSE
        RETURN( config.is_solution_for\class_specification_association.association_type = 'design case' );
      END_IF;
    END_IF;
    RETURN( FALSE );

IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.ABSTRACT_VARIABLE' IN TYPEOF( x ) THEN
      RETURN( TRUE );
    ELSE
      IF ( 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.FUNC' IN TYPEOF( x ) ) AND ( SIZEOF( QUERY ( y <* x.terms | 
          contains_variable( y ) ) ) > 0 ) THEN
        RETURN( TRUE );
      ELSE
        RETURN( FALSE );
      END_IF;
    END_IF;

LOCAL
      acr : SET OF assembly_component_relationship := input\assembly_component.occurrence_contexts;
      pvd : SET OF product_view_definition := [];
    END_LOCAL;
    REPEAT i := 1 TO HIINDEX( acr ) BY 1;
      IF NOT ( ( 'LAYERED_INTERCONNECT_MODULE_DESIGN_ARM.' + 'STRUCTURED_LAYOUT_COMPONENT' ) IN TYPEOF( acr[i]\
          product_occurrence_definition_relationship.relating_view ) ) THEN
        pvd := pvd + acr[i]\product_occurrence_definition_relationship.relating_view;
      ELSE
        pvd := pvd + get_assemblies( acr[i]\product_occurrence_definition_relationship.relating_view );
      END_IF;
    END_REPEAT;
    RETURN( pvd );

LOCAL
      dd : SET [0 : ?] OF document_definition := [];
      da : SET [0 : ?] OF document_assignment := [];
    END_LOCAL;
    da := bag_to_set( QUERY ( dr <* USEDIN( input, 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.' + 'DOCUMENT_ASSIGNMENT.'
        + 'IS_ASSIGNED_TO'  ) | ( dr.role = role ) ) );
    REPEAT i := 1 TO SIZEOF( da ) BY 1;
      IF type_name IN TYPEOF( da[i].assigned_document ) THEN
        dd := dd + da[i].assigned_document;
      END_IF;
    END_REPEAT;
    RETURN( dd );

LOCAL
      sda : SET OF shape_description_association := [];
      gm  : SET OF geometric_model := [];
    END_LOCAL;
    sda := bag_to_set( USEDIN( input, 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.PROPERTY_DEFINITION_REPRESENTATION.'
        + 'DEFINITION'  ) );
    REPEAT i := 1 TO SIZEOF( sda ) BY 1;
      IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.SHAPE_DESCRIPTION_ASSOCIATION' IN TYPEOF( sda[i] ) THEN
        gm := gm + sda[i]\property_definition_representation.used_representation;
      END_IF;
    END_REPEAT;
    RETURN( gm );

LOCAL
      result : SET OF oriented_joint := [];
    END_LOCAL;
    IF SIZEOF( kls ) > 0 THEN
      REPEAT i := 1 TO HIINDEX( kls ) BY 1;
        result := result + kls[i].edge_list;
      END_REPEAT;
    END_IF;
    RETURN( get_kinematic_joints_from_oriented_joints( result ) );

LOCAL
      result : SET OF kinematic_joint := [];
    END_LOCAL;
    IF SIZEOF( ors ) > 0 THEN
      REPEAT i := 1 TO HIINDEX( ors ) BY 1;
        result := result + ors[i].edge_definition;
      END_REPEAT;
    END_IF;
    RETURN( result );

LOCAL
      dqdr  : BAG OF data_quality_definition_representation_relationship := [];
      pdqdr : BAG OF product_data_and_data_quality_relationship := [];
      pd    : BAG OF product_view_definition := [];
    END_LOCAL;
    dqdr := USEDIN( dqir, 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.' + 
        'DATA_QUALITY_DEFINITION_REPRESENTATION_RELATIONSHIP.'  + 'USED_REPRESENTATION' );
    REPEAT i := 1 TO SIZEOF( dqdr ) BY 1;
      pdqdr := USEDIN( dqdr[i].definition, 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.' + 
          'PRODUCT_DATA_AND_DATA_QUALITY_RELATIONSHIP.'  + 'DATA_QUALITY' );
      REPEAT j := 1 TO SIZEOF( pdqdr ) BY 1;
        pd := pd + pdqdr[j].product_data;
      END_REPEAT;
    END_REPEAT;
    RETURN( pd );

LOCAL
      i : INTEGER;
    END_LOCAL;
    IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.INT_LITERAL' IN TYPEOF( arg ) THEN
      RETURN( TRUE );
    END_IF;
    IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.REAL_LITERAL' IN TYPEOF( arg ) THEN
      RETURN( FALSE );
    END_IF;
    IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.INT_NUMERIC_VARIABLE' IN TYPEOF( arg ) THEN
      RETURN( TRUE );
    END_IF;
    IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.REAL_NUMERIC_VARIABLE' IN TYPEOF( arg ) THEN
      RETURN( FALSE );
    END_IF;
    IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.ABS_FUNCTION' IN TYPEOF( arg ) THEN
      RETURN( is_int_expr( arg\unary_numeric_expression.operand ) );
    END_IF;
    IF 'NUMERIC_FUNCTION.MINUS_FUNCTION' IN TYPEOF( arg ) THEN
      RETURN( is_int_expr( arg\unary_numeric_expression.operand ) );
    END_IF;
    IF ( 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.SIN_FUNCTION' IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.COS_FUNCTION'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.TAN_FUNCTION'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.ASIN_FUNCTION'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.ACOS_FUNCTION'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.ATAN_FUNCTION'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.EXP_FUNCTION'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.LOG_FUNCTION'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.LOG2_FUNCTION'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.LOG10_FUNCTION'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.SQUARE_ROOT_FUNCTION'  IN TYPEOF( arg ) ) THEN
      RETURN( FALSE );
    END_IF;
    IF ( 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.PLUS_EXPRESSION' IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.MULT_EXPRESSION'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.MAXIMUM_FUNCTION'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.MINIMUM_FUNCTION'  IN TYPEOF( arg ) ) THEN
      REPEAT i := 1 TO SIZEOF( arg\multiple_arity_numeric_expression.operands ) BY 1;
        IF NOT is_int_expr( arg\multiple_arity_numeric_expression.operands[i] ) THEN
          RETURN( FALSE );
        END_IF;
      END_REPEAT;
      RETURN( TRUE );
    END_IF;
    IF ( 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.MINUS_EXPRESSION' IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.POWER_EXPRESSION'  IN TYPEOF( arg ) ) THEN
      RETURN( is_int_expr( arg\binary_numeric_expression.operands[1] ) AND is_int_expr( arg\binary_numeric_expression.operands[2] ) );
    END_IF;
    IF ( 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.DIV_EXPRESSION' IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.MOD_EXPRESSION'  IN TYPEOF( arg ) ) THEN
      RETURN( TRUE );
    END_IF;
    IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.SLASH_EXPRESSION' IN TYPEOF( arg ) THEN
      RETURN( FALSE );
    END_IF;
    IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.LENGTH_FUNCTION' IN TYPEOF( arg ) THEN
      RETURN( TRUE );
    END_IF;
    IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.FUNCTION_PARAMETER_VALUE' IN TYPEOF( arg ) THEN
      IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.INT_VALUE_FUNCTION' IN TYPEOF( arg ) THEN
        RETURN( TRUE );
      ELSE
        RETURN( FALSE );
      END_IF;
    END_IF;
    IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.INTEGER_DEFINED_FUNCTION' IN TYPEOF( arg ) THEN
      RETURN( TRUE );
    END_IF;
    IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.REAL_DEFINED_FUNCTION' IN TYPEOF( arg ) THEN
      RETURN( FALSE );
    END_IF;
    IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.BOOLEAN_DEFINED_FUNCTION' IN TYPEOF( arg ) THEN
      RETURN( FALSE );
    END_IF;
    IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.STRING_DEFINED_FUNCTION' IN TYPEOF( arg ) THEN
      RETURN( FALSE );
    END_IF;
    RETURN( FALSE );

LOCAL
      i : INTEGER;
    END_LOCAL;
    IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.SIMPLE_NUMERIC_EXPRESSION' IN TYPEOF( arg ) THEN
      RETURN( TRUE );
    END_IF;
    IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.SQL_MAPPABLE_DEFINED_FUNCTION' IN TYPEOF( arg ) THEN
      RETURN( TRUE );
    END_IF;
    IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.MINUS_FUNCTION' IN TYPEOF( arg ) THEN
      RETURN( is_sql_mappable( arg\unary_numeric_expression.operand ) );
    END_IF;
    IF ( 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.ABS_FUNCTION' IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.SIN_FUNCTION'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.COS_FUNCTION'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.TAN_FUNCTION'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.ASIN_FUNCTION'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.ACOS_FUNCTION'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.ATAN_FUNCTION'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.EXP_FUNCTION'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.LOG_FUNCTION'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.LOG2_FUNCTION'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.LOG10_FUNCTION'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.SQUARE_ROOT_FUNCTION'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.FUNCTION_PARAMETER_VALUE'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.LENGTH_FUNCTION'  IN TYPEOF( arg ) ) THEN
      RETURN( FALSE );
    END_IF;
    IF ( 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.PLUS_EXPRESSION' IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.MULT_EXPRESSION'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.MAXIMUM_FUNCTION'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.MAXIMUM_FUNCTION'  IN TYPEOF( arg ) ) THEN
      REPEAT i := 1 TO SIZEOF( arg\multiple_arity_numeric_expression.operands ) BY 1;
        IF NOT is_sql_mappable( arg\multiple_arity_numeric_expression.operands[i] ) THEN
          RETURN( FALSE );
        END_IF;
      END_REPEAT;
      RETURN( TRUE );
    END_IF;
    IF ( 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.MINUS_EXPRESSION' IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.SLASH_EXPRESSION'  IN TYPEOF( arg ) ) THEN
      RETURN( is_sql_mappable( arg\binary_numeric_expression.operands[1] ) AND is_sql_mappable( arg\binary_numeric_expression.
          operands[2] ) );
    END_IF;
    IF ( 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.DIV_EXPRESSION' IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.MOD_EXPRESSION'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.POWER_EXPRESSION'  IN TYPEOF( arg ) ) THEN
      RETURN( FALSE );
    END_IF;
    IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.SIMPLE_BOOLEAN_EXPRESSION' IN TYPEOF( arg ) THEN
      RETURN( TRUE );
    END_IF;
    IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.NOT_EXPRESSION' IN TYPEOF( arg ) THEN
      RETURN( is_sql_mappable( arg\unary_generic_expression.operand ) );
    END_IF;
    IF ( 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.ODD_FUNCTION' IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.XOR_EXPRESSION'  IN TYPEOF( arg ) ) THEN
      RETURN( FALSE );
    END_IF;
    IF ( 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.AND_EXPRESSION' IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.OR_EXPRESSION'  IN TYPEOF( arg ) ) THEN
      REPEAT i := 1 TO SIZEOF( arg\multiple_arity_boolean_expression.operands ) BY 1;
        IF NOT is_sql_mappable( arg\multiple_arity_boolean_expression.operands[i] ) THEN
          RETURN( FALSE );
        END_IF;
      END_REPEAT;
      RETURN( TRUE );
    END_IF;
    IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.EQUALS_EXPRESSION' IN TYPEOF( arg ) THEN
      RETURN( is_sql_mappable( arg\binary_generic_expression.operands[1] ) AND is_sql_mappable( arg\binary_generic_expression.
          operands[2] ) );
    END_IF;
    IF ( 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.COMPARISON_EQUAL' IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.COMPARISON_GREATER'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.COMPARISON_GREATER_EQUAL'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.COMPARISON_LESS'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.COMPARISON_LESS_EQUAL'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.COMPARISON_NOT_EQUAL'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.LIKE_EXPRESSION'  IN TYPEOF( arg ) ) THEN
      RETURN( is_sql_mappable( arg\comparison_expression.operands[1] ) AND is_sql_mappable( arg\comparison_expression.operands[2] ) );
    END_IF;
    IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.INTERVAL_EXPRESSION' IN TYPEOF( arg ) THEN
      RETURN( is_sql_mappable( arg\interval_expression.interval_low ) AND is_sql_mappable( arg\interval_expression.interval_high ) 
          AND is_sql_mappable( arg\interval_expression.interval_item ) );
    END_IF;
    IF ( 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.NUMERIC_DEFINED_FUNCTION' IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.BOOLEAN_DEFINED_FUNCTION'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.STRING_DEFINED_FUNCTION'  IN TYPEOF( arg ) ) THEN
      RETURN( FALSE );
    END_IF;
    IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.SIMPLE_STRING_EXPRESSION' IN TYPEOF( arg ) THEN
      RETURN( TRUE );
    END_IF;
    IF ( 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.INDEX_EXPRESSION' IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.SUBSTRING_EXPRESSION'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.CONCAT_EXPRESSION'  IN TYPEOF( arg ) ) OR ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.FORMAT_FUNCTION'  IN TYPEOF( arg ) ) THEN
      RETURN( FALSE );
    END_IF;
    RETURN( FALSE );

IF ( ( ( year MOD 4 ) = 0 ) AND ( ( year MOD 100 ) <> 0 ) ) OR ( ( year MOD 400 ) = 0 ) THEN
      RETURN( TRUE );
    ELSE
      RETURN( FALSE );
    END_IF;

LOCAL
      i : INTEGER;
      j : INTEGER;
      k : INTEGER;
    END_LOCAL;
    IF ( 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.ABSTRACT_VARIABLE' IN TYPEOF( thing ) ) AND ( 
        'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.RULE_DEFINITION'  IN TYPEOF( thing.scope ) ) THEN
      accum := accum + thing;
    ELSE
      IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.RULE_CONDITION' IN TYPEOF( thing ) THEN
        REPEAT i := 1 TO HIINDEX( thing\atomic_formula.terms ) BY 1;
          accum := local_vars_aux( thing\atomic_formula.terms[i], accum );
        END_REPEAT;
      ELSE
        IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.SIMPLE_CLAUSE' IN TYPEOF( thing ) THEN
          REPEAT j := 1 TO HIINDEX( thing.formulas ) BY 1;
            accum := local_vars_aux( thing.formulas[j], accum );
          END_REPEAT;
        ELSE
          IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.COMPLEX_CLAUSE' IN TYPEOF( thing ) THEN
            REPEAT k := 1 TO HIINDEX( thing.clauses ) BY 1;
              accum := local_vars_aux( thing.clauses[k], accum );
            END_REPEAT;
          END_IF;
        END_IF;
      END_IF;
    END_IF;
    RETURN( accum );

LOCAL
      accum : SET [0 : ?] OF scalar_variable := [];
    END_LOCAL;
    RETURN( local_vars_aux( thing, accum ) );

LOCAL
      i           : INTEGER;
      numeric_set : SET [2 : ?] OF NUMBER := [start, start + delta];
    END_LOCAL;
    IF incs > 1 THEN
      REPEAT i := 2 TO incs BY 1;
        numeric_set := numeric_set + start + ( i * delta );
      END_REPEAT;
    END_IF;
    RETURN( numeric_set );

LOCAL
      n : INTEGER;
      p : LOGICAL := TRUE;
    END_LOCAL;
    n := SIZEOF( a_path.edge_list );
    REPEAT i := 2 TO n BY 1;
      p := p AND ( a_path.edge_list[i - 1].edge_end :=: a_path.edge_list[i].edge_start );
    END_REPEAT;
    RETURN( p );

